// src/components/Frame5.js
import React from "react";
import { Link } from "react-router-dom";
import { useLocation } from 'react-router-dom';
import "../styles.css"; 

function Frame5() {
  const location = useLocation();
  // Extract the opportunity data from location state (if available)
  const { opportunity } = location.state || {};
  return (
    <div className="frame5"style={{marginTop: "-95px"}}>
      <div className="textArbitrageNotFound">
        No Arbitration Opportunities Found :(
      </div>
      <Link className="textMoreSports" to="/frame3">
        More Sports
      </Link>
      <div className="rectangleMore"></div>
      <div className="linef5"></div>
    </div>

  );
}

export default Frame5;
